import React from 'react';
import classes from './index.module.css'
import Header from './components/header/header';
import Content from './components/content/content';
import Footer from './components/footer/footer';
import Dialogs from "./components/dialogs/dialogs";
import {BrowserRouter, Route} from "react-router-dom";

const App = (props) => {
    return (

        <BrowserRouter>
            <div className="main">
                <Header link={props.state}/>
                <div className={classes.container}>
                    <Route path='/dialog' render={() => <Dialogs appMessage={props.state.messagePage} dispatch={props.dispatch} message={props.state.messagePage.messagesData}
                                                                 elements={props.state.messagePage.dialogsData}/>}/>
                    <Route path='/profile' render={() => <Content dispatch={props.dispatch} posts={props.state.profilePage}/>}/>
                </div>
                <Footer/>
            </div>
        </BrowserRouter>
    );
}
export default App;
